import React, { Component } from 'react'
import { Link } from 'react-router-dom';
import NotesList from './NotesList';

class NotesNote extends Component {

  render() {
  //   if (this.props.fetching){
  //     return (<div></div>)
  // }
    return (
      <div className="anobato">
      {this.props.notes.map(note => {
                 return (
                     <div className="note" key={note.id}>
                         <Link to={`/notesview/${note.id}`}>
                             <NotesList title={note.title} content={note.textBody} />
                             <Route path="/notesview/:id" render={props => (
                                <SingleNote {...props} note={this.props.note} />

        )}  />
                         </Link>
                     </div>
                 )
             })}
         </div>
         )
     }
 }

 export default NotesNote;
